import headerLogo from "../../images/Logo.svg";
import {
  ButtonAnchor,
  Container,
  Logo,
  NavContainer,
  WideContainer,
} from "./Header.styled";

const Header = () => {
  return (
    <Container>
      <WideContainer>
        <Logo src={headerLogo} alt="header-logo" />
        <NavContainer>
          <ButtonAnchor href="#users-list">Users</ButtonAnchor>
          <ButtonAnchor href="#sign-in-form">Sign Up</ButtonAnchor>
        </NavContainer>
      </WideContainer>
    </Container>
  );
};

export default Header;
